import React from 'react';
import './card.css';
import { Link } from 'react-router-dom';
const Card = () => {
  const nfts = [
    { src: `${process.env.PUBLIC_URL}/images/g4.jpeg`, title: "NFT 1" },
    { src: `${process.env.PUBLIC_URL}/images/g4.jpeg`, title: "NFT 2" },
    { src: `${process.env.PUBLIC_URL}/images/g4.jpeg`, title: "NFT 3" },
    { src: `${process.env.PUBLIC_URL}/images/g4.jpeg`, title: "NFT 2" },
    { src: `${process.env.PUBLIC_URL}/images/g4.jpeg`, title: "NFT 1" },
    { src: `${process.env.PUBLIC_URL}/images/g4.jpeg`, title: "NFT 2" },
    { src: `${process.env.PUBLIC_URL}/images/g4.jpeg`, title: "NFT 3" },
    { src: `${process.env.PUBLIC_URL}/images/g4.jpeg`, title: "NFT 2" },
  ];

  const nfts1 = [
    { src: `${process.env.PUBLIC_URL}/images/g1.png`, title: "NFT 1" },
    { src: `${process.env.PUBLIC_URL}/images/g2.png`, title: "NFT 2" },
    { src: `${process.env.PUBLIC_URL}/images/g3.png`, title: "NFT 3" },
    { src: `${process.env.PUBLIC_URL}/images/g2.png`, title: "NFT 2" },
    { src: `${process.env.PUBLIC_URL}/images/g1.png`, title: "NFT 1" },
    { src: `${process.env.PUBLIC_URL}/images/g2.png`, title: "NFT 2" },
    { src: `${process.env.PUBLIC_URL}/images/g3.png`, title: "NFT 3" },
    { src: `${process.env.PUBLIC_URL}/images/g2.png`, title: "NFT 2" },
  ];

  return (
<>
<div className="container">
      <div className="row">
        {[...Array(4)].map((_, index) => (
          <div className="col-sm-3 card-container" key={index}>
            <div className="card">
              <img src={`${process.env.PUBLIC_URL}/images/a8.png`} alt="Background" className="background"/>
              <img src={`${process.env.PUBLIC_URL}/images/a19.png`} className="top-right small-image" alt="Top Right 1"/>
              <img src={`${process.env.PUBLIC_URL}/images/a19.png`} alt="Top Right 2" className="top-right small-image"/>
              <img src={`${process.env.PUBLIC_URL}/images/a20.png`} className="bottom-left small-image" alt="Bottom Left"/>
              <img src={`${process.env.PUBLIC_URL}/images/g4.jpeg`} alt="Main Image" className="main-image"/>
            </div>
          </div>
        ))}
      </div>
    </div>
    </>
  );
};

export default Card;
